function Car(props){

    console.log(props.brand.brand);

    return(
        <li>Name : {props.brand.brand} Id: props.brand.id</li>
    );
}

function NewList(){
    const cars = [
        {id: 1, brand: 'Ford'},
        {id: 2, brand: 'BMW'},
        {id: 3, brand: 'Audi'}
      ];

    return(
        <>
            <ul>
                {cars.map((car) => <Car key={car.id} brand={car} />)}
            </ul>
        </>
    )
}

export default NewList;
